    false,nt"url": null,nt"notes": "The EX-12-05 Leg 1 cruise represents a
    partnership between NOAA Okeanos Explorer Program, National Science Foundation (NSF)
    and Woods Hole Oceanographic Institution (WHOI) - with each partner bringing different
    but complementary objectives to the table. NOAA's Office of Ocean Exploration and
    Research (OER)  primary focus during EX-12-05 Leg 1 is to test the use of an AUV
    operated from the Okeanos Explorer while the ship is outfitted for "full" exploration
    mode (with joint ROV operations) and to explore what it will take to integrate an
    AUV into telepresence-enabled exploration. NSF and WHOI objectives for this cruise
    include a series of engineering trials and experiments of the Sentry AUV capabilities.
    NSF objectives for this cruise also include survey data collection using the Sentry
    AUV and Okeanos Explorer systems that will support a follow-on NSF-funded project
    at Blake Ridge in 2013 with Principal Investigator, Cindy Van Dover.",nt"owner_org":
